/* harmony default export */ __webpack_exports__["default"] = ("<mat-card-content class=\"health_risk_report\">\n  <table>\n    <tr>\n\n      <td colspan=\"4\"><h2 class=\"ordering_phy\">Ordering Physician:</h2></td>\n      <td colspan=\"1\"><input class=\"order_input\" type=\"text\"></td>\n    </tr>\n    <tr>\n      <td colspan=\"5\"><h1 class=\"rm_phy\">RM-3A Clinical Report Evaluation Worksheet</h1></td>\n    </tr>\n\n    <tr>\n      <td colspan=\"3\">Patient Name: <input type=\"text\"></td>\n      <td colspan=\"1\">Patient Gender: <label><input type=\"checkbox\">Male</label> <label><input type=\"checkbox\">Female</label></td>\n      <td colspan=\"1\">D.O.B: <input type=\"text\" ></td>\n    </tr>\n\n\n    <tr>\n        <td colspan=\"3\">Test Date: <input type=\"text\"></td>\n        <td colspan=\"1\">Tests Completed: <input type=\"text\"></td>\n\n      </tr>\n\n\n    <!-- analytic -->\n\n\n    <tr>\n      <th>Risk Maker</th>\n      <th>Report\n        Page(s)</th>\n      <th>Current\n        Risk\n        Status</th>\n      <th>Description of Marker</th>\n      <th>Potential ICD 10 Code or other Recommendations</th>\n    </tr>\n\n    <tr>\n      <td>PTGTP </td>\n      <td> 3 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Helps to identify the risk of insulin resistance (Pre-diabetes &\n          diabetes), heart disease and other metabolic disorders. High\n          numbers may be associated with fatty liver and atherosclerosis</p>\n      </td>\n      <td>\n        <p>\n          If PTGVLFI and IR are above normal, and the patient\n          has not been diagnosed with Diabetes previously, use\n          the Diabetes ICD 10 codes E10.40-E13.610G (with one\n          other qualified morbidity), or use ICD 10 code G90.3\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>PTGVLFI </td>\n      <td> 3 & 6 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for Diabetes</b> - is a marker for impaired glucose\n          tolerance (IGT) and Microcirculation complications.</p>\n      </td>\n      <td>\n        <p>\n          Use the ICD 10 Diabetes Codes E10.40-E13.610 if IR and\n          PTGTP shown above are Abnormal or High Risk. Or if\n          already diagnosed use ICD 10 Code G90.3\n\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>IR </td>\n      <td> 1 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for Impaired Glucose Tolerance (IGT), Type 2 Diabetes\n            (T2DM) and cardiovascular diseases.</b>Comparing our PTGTP\n          marker vs the HE Clamp; our Marker has a sensitivity of 90%\n          and specificity of 90%</p>\n      </td>\n      <td>\n        <p>\n          E10.40-E13.610 if Diabetes has not already been\n          Diagnosed and there is also any other qualified\n          morbidity not previously diagnosed and treated (see\n          each Diabetes related ICD 10’s description). Or use ICD\n          10 Code 90.3 if both of the above have been diagnosed.\n        </p>\n      </td>\n    </tr>\n\n\n    <tr>\n      <td>ESRNO\n        Baseline </td>\n      <td> 7 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for Distal Neuropathy </b> - is a marker of electrical skin\n          response to nitric oxide (NO) production and vasodilation. Low\n          numbers indicate risk of distal neuropathy.</p>\n      </td>\n      <td>\n        <p>\n          G60.3, G60.8, G60.9 or a combination of diabetes and\n          Neuropathy if Diabetes has not already been diagnosed\n          (or ICD 10 code 90.3 if already diagnosed)\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>ESR L<br>\n        (Latency)</td>\n      <td> 7</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for Peripheral Distal Neuropathy</b> - is a marker of sweat\n          gland nerve density. Low numbers are an early detection of\n          peripheral distal neuropathy</p>\n      </td>\n      <td>\n        <p>\n          G60.3, G60.8, G60.9 or a combination of diabetes and\n          Neuropathy if Diabetes has not already been diagnosed\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>Peak C<br>\n        (Amplitude)</td>\n      <td> 7 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker of sweat gland function. Low Peak C numbers are found\n          with nerve damage or Hyperhidrosis.</p>\n      </td>\n      <td>\n        <p>\n          Shows Nerve Damage and indicates additional testing\n          or use ICD 10 Code R61 if patient has excessive sweat\n          (Hyperhidrosis) which will show on the foot plates)\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>PTG Type<br>\n        ( Enter Type 1-5 )\n      </td>\n      <td> 6</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for Arterial Aging</b>– The pulse wave velocity (PWV) and\n          the photoplethysmogram (PTG) are noninvasive methods for\n          evaluating the pulse wave. a score of 1 to 2 is normal. A score of\n          3 is Abnormal and a score of 4 or 5 is High</p>\n      </td>\n      <td>\n        <p>\n          Use ICD 10 code 173.9 for Peripheral Vascular Disease\n          or, depending on RI below, choose one of the\n          Atherosclerosis ICD 10 codes 170.209, 219 or 229.\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>PTG CVD\n      </td>\n      <td> 3</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker used to evaluate CVD. A score of 0 = normal, 1 =\n          borderline and 2 = abnormal.</p>\n      </td>\n      <td>\n        <p>\n          Use ICD 10 code I25.10 - Atheroslerotic\n          heart disease of native coronary artery\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>Stress I<br>\n        (Stress Index)\n\n      </td>\n      <td> 2, 3 and 4 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker heart disease</b> - correlates to C-Reactive Protein\n          (CRP) and high numbers indicate a risk of Heart disease.</p>\n      </td>\n      <td>\n        <p>\n          If not already diagnosed and there is no\n          indication of PAD, CVD or Atherosclerosis, use ICD\n          10 Code I51.90\n\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>RI </td>\n      <td> 3 & 6</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker for Atherosclerosis - an indicator of stiffness of the\n          small and medium arteries.\n        </p>\n      </td>\n      <td>\n        <p>\n          Use ICD 10 codes I70.209, 219 0r 229 if PTG R is also\n          above normal (choice of ICD 10 code 173.9 is also an\n          acceptable ICD 10 Code, at MD, NP or PA’s discretion)\n\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>AIPTG<br>\n        (IPTG) </td>\n      <td>3 & 6</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p><b>Marker for LDL Cholesterol Level.</b> High LDL Cholesterol is a\n          Marker for Coronary Heart Disease (CHD) –\n\n        </p>\n      </td>\n      <td>\n        <p>\n          Additional LDL Cholesterol Testing when Abnormal or\n          High Risk\n\n\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>CIs (CI)</td>\n      <td> 5</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker is an indicator that relates to Cardiac output to Body\n          Surface Area (BSA)\n\n        </p>\n      </td>\n      <td>\n        <p>\n          Shows a need for more Cardio Exercise unless\n          prohibited due to other heart disease issues\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>pNN50</td>\n      <td>4</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker for heart rhythm stability. Shows a risk of\n          Heart Rate Variability issues\n        </p>\n      </td>\n      <td>\n        <p>\n          Use ICD 10 Code R00.0\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>RMSSD</td>\n      <td> 2 & 4 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker that reflects the electrical stability of the heart\n        </p>\n      </td>\n      <td>\n        <p>\n          Suggests additional Cardiometabolic testing for\n          potential of tachycardia or other related issues\n\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>SD ba</td>\n      <td> 6 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Marker for angiotensin activity </p>\n      </td>\n      <td>\n        <p>\n          Angiotensin is a peptide hormone that causes\n          vasoconstriction and increase in blood pressure. It also\n          stimulates the release of aldosterone from the adrenal\n          cortex to promote sodium retention by the kidneys.\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>DPRS</td>\n      <td> 2 & 5 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Diastolic Pressure Response to Standing (DPRS) is the\n          difference between the sitting diastolic minus the\n          standing diastolic pressure. Normal <=5 ->=10 mmHg.</p>\n      </td>\n      <td>\n        <p>\n          If above normal, additional cardio exercise may be\n          recommended and possibly the need for additional\n          Cardiometabolic testing.\n\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>ValsR</td>\n      <td> 2 & 5 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>Valsalva Ratio (ValsR.) - is the measure of the Heart Rate\n          response to Blood Pressure changes from the mechanical\n          and cardiovascular effects of the Valsalva Maneuver.</p>\n      </td>\n      <td>\n        <p>\n          If above normal, additional cardio exercise may be\n          suggested after additional Cardiometabolic testing.\n\n        </p>\n      </td>\n    </tr>\n    <tr>\n      <td>BMI<br>\n        Enter BMI\n        Score\n        (I.E. 29.1)</td>\n      <td> 1-7</td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>The National Institutes of Health (NIH) now defines normal\n          weight, overweight, and obesity according to BMI rather\n          than the traditional height/weight charts. Overweight is a\n          BMI of 27.3 or more for women and 27.8 or more for men.\n          29 or above qualifies a person for Intensive Behavioral\n          Therapy for Obesity. Medicare has no deductible or Co</p>\n      </td>\n      <td>\n        <p>\n          If the BMI reading is 30 or above, Obesity\n          Counseling is paid for by Medicare with no co-pay\n          or deductable. Most Comercial Carriers are paying\n          for this program as well Click Here for Medicare\n          Guidelines or Request document via e-mail at\n          gmw@ourwhy-deas.com.\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td>Blood Pressure <br>\n        Systolic &\n        Diastolic\n        (120/80)</td>\n      <td>3 </td>\n      <td><input type=\"text\"></td>\n      <td>\n        <p>As of April 2018, The American Heart Association defines\n          Hypertension as 130/80 millimeters of mercury (mm Hg)\n          and higher for all adults (The previous guidelines set the\n          threshold at 140/90 mm Hg for people younger than age\n          65, and 150/80 mm Hg for those ages 65 and older).</p>\n      </td>\n      <td>\n        <p>\n          use ICD10 Diagnostic Code I10\n\n        </p>\n      </td>\n    </tr>\n\n    <tr>\n      <td colspan=\"5\">\n        <p class=\"area_header\"><b>Patient Diagnoses & Notes:</b></p>\n        <textarea class=\"area_content\"></textarea>\n      </td>\n    </tr>\n    <tr>\n        <td colspan=\"5\">\n          <p ><b>IMPORTANT DISCLAIMER NOTE: The above are only patient recommendations and suggested ICD-10 codes based on the Risk Markers identified and\n              what they have been proven to identify risk for. No Medical Doctor, NP or Pa was involved in these determinations. For Insurance claim process to\n              be valid, a qualified M.D, D.O, NP or PA must establish their own independent diagnoses. </b></p>\n\n        </td>\n      </tr>\n  </table>\n</mat-card-content>\n");

